import React from 'react';
import { Row, Col } from 'react-bootstrap';
import AnnouncementCard from './AnnouncementCard';

function AnnouncementsTile({ title, announcements }) {
    return (
        <Row className="justify-content-center"> {/* Add the justify-content-center class */}
            <Col xs={12}> {/* Set the column width to xs={12} to take up the full width */}
                <h2>{title}</h2>
            </Col>
            <Col xs={12}> {/* Set the column width to xs={12} to take up the full width */}
                <div className="row row-cols-3">
                    {announcements.map((announcement) => (
                        <AnnouncementCard key={announcement.id} announcement={announcement} />
                    ))}
                </div>
            </Col>
        </Row>
    );
}

export default AnnouncementsTile;
